import './App.css';
import {useState} from "react";



// 최상위 컴포넌트
function App() {
  const [count, setCount] = useState(100)
  const onClick_ = () => {
    count += 1;
    return count;
  }
  return (
    <div>
      <h1>Total Count: ${count}</h1>
      <button onClick={onClick_}>증가</button><br/>
    </div>
  );
}

export default App;
